import React from 'react';
import Todos from './components/Todos';

function App() {
  const dummyData = [
    {
      id: 1,
      title: 'Hey From Egypt',
      completed: false,
    },
    {
      id: 2,
      title: 'Hello From England',
      completed: false,
    },
    {
      id: 3,
      title: 'Bounjoure From Paris',
      completed: false,
    },
  ];

  return (
    <>
      <section>
        <button>Fetch</button>
      </section>
      <section>
        <Todos todos={dummyData} />
      </section>
    </>
  );
}

export default App;

